category = "dev"
optional = false
python-versions = "*"

[package.dependencies]
botocore = ">=1.11.3"
future = "*"
wrapt = "*"

[[package]]
name = "beartype"
version = "0.9.1"
description = "Unbearably fast runtime type checking in pure Python."
category = "main"
optional = false
python-versions = ">=3.6.0"

[package.extras]
all = ["typing-extensions (>=3.10.0.0)"]
dev = ["coverage (>=5.5)", "sphinx", "typing-extensions", "mypy (>=0.800)", "numpy", "pytest (>=4.0.0)", "tox (>=3.20.1)", "sphinx (>=4.1.0)"]
